import React from 'react';
// import '../../App.css';
import './home.css'

export default function Home() {
  return (
    <>
      <div className="row">
        <div className="col-md-6">
          <div class="card">
            <div class="card-body">
              This is some text within a card body.
            </div>
          </div>
        </div>
        <div className="col-md-6">Hai</div>
      </div>

    </>
  );
}
